import React from 'react';
import { HashRouter as Router, Routes, Route } from 'react-router-dom';
import Home from '/components/Home'
import './App.css';

function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route path='/'>
          <Route index element={<Home />} />
        </Route>
      </Routes>
    </Router>
    </>
  );
}

export default App;
